  \"The Earth Data Analysis Center (EDAC) at the University of New Mexico is an Applied
  Research Center that specializes in geospatial data development, management, analysis
  and applications. Through partnerships with collaborators in public health, emergency
  management and planning, resource management, transportation, water resources and
